Insert into FINAL.BOOK_REG (BR_BNUMBER,BR_STUDENT_ID,BR_NAME,BR_CATEGORY,BR_WRITER,BR_PUBLISHER,BR_ISSUE_DATE,BR_COUNT,BR_ISBN,BR_CONDITION,BR_COMMENT,BR_PRICE,BR_REG_DATE,BR_MOD_DATE,BR_STATUS,BS_ORDER_STATUS,ORIGINAL_FILENAME,RENAME_FILENAME) values (1,'201402386','공기업단기 NCS(2019)(커넥츠)','공학계열','공기업단기 NCS출제연구소','에스티유니타스',to_date('18/12/14','RR/MM/DD'),0,null,'B','<p>1.사진에서 보는 것 처럼 문제 위에 채점 조금만하게 되어있는거 빼고 깨끗합니다<br />
Insert into FINAL.BOOK_REG (BR_BNUMBER,BR_STUDENT_ID,BR_NAME,BR_CATEGORY,BR_WRITER,BR_PUBLISHER,BR_ISSUE_DATE,BR_COUNT,BR_ISBN,BR_CONDITION,BR_COMMENT,BR_PRICE,BR_REG_DATE,BR_MOD_DATE,BR_STATUS,BS_ORDER_STATUS,ORIGINAL_FILENAME,RENAME_FILENAME) values (2,'201402386','이상심리학의 기초','인문/사회계열','권석만','학지사',to_date('14/02/15','RR/MM/DD'),0,'9788999702907','A','<p>『이상심리학의 기초』는 크게 12장으로 구성된 책이다. 이상심리학의 기본적 이해를 비롯하여, 불안장애, 강박장애, 외상후 스트레스 장애와 해리장애, 우울장애와 양극성 장애, 정신분열 스펙트럼 장애, 성격장애, 섭식장애와 물질중독 장애, 정신장애의 치료와 예방 등의 내용이 수록되어 있다.</p>
Insert into FINAL.BOOK_REG (BR_BNUMBER,BR_STUDENT_ID,BR_NAME,BR_CATEGORY,BR_WRITER,BR_PUBLISHER,BR_ISSUE_DATE,BR_COUNT,BR_ISBN,BR_CONDITION,BR_COMMENT,BR_PRICE,BR_REG_DATE,BR_MOD_DATE,BR_STATUS,BS_ORDER_STATUS,ORIGINAL_FILENAME,RENAME_FILENAME) values (3,'201402386','미분적분학 1 2 세트','공학계열','James Stewart','교우사',to_date('14/02/25','RR/MM/DD'),0,'9791125100027','B','<h3>분량을 줄이고 효율을 높인 미분적분 교재!</h3>
Insert into FINAL.BOOK_REG (BR_BNUMBER,BR_STUDENT_ID,BR_NAME,BR_CATEGORY,BR_WRITER,BR_PUBLISHER,BR_ISSUE_DATE,BR_COUNT,BR_ISBN,BR_CONDITION,BR_COMMENT,BR_PRICE,BR_REG_DATE,BR_MOD_DATE,BR_STATUS,BS_ORDER_STATUS,ORIGINAL_FILENAME,RENAME_FILENAME) values (4,'201402386','수치해석','공학계열','최종근','텍스트북스',to_date('10/09/01','RR/MM/DD'),0,'9788993543186','A','<p>『수치해석』은 각 수치해법의 이름, 개념, 계산과정, 특징과 한계 등을 명확히 보여주는 책이다. 특히 한 번의 계산과정을 구체적으로 제시함으로써 누구나 그 개념과 원리를 이해할 수 있도록 구성하였다. 더불어 전문용어는 가능한 의미 중심의 한글명칭을 사용하였으며 각 장에서 처음으로 사용될 때 영어명칭을 함께 표기하였다.</p>
Insert into FINAL.BOOK_REG (BR_BNUMBER,BR_STUDENT_ID,BR_NAME,BR_CATEGORY,BR_WRITER,BR_PUBLISHER,BR_ISSUE_DATE,BR_COUNT,BR_ISBN,BR_CONDITION,BR_COMMENT,BR_PRICE,BR_REG_DATE,BR_MOD_DATE,BR_STATUS,BS_ORDER_STATUS,ORIGINAL_FILENAME,RENAME_FILENAME) values (5,'201400215','열린 사고와 표현','인문/사회계열','김영주 , 김인선, 김종기, 손남훈, 서용태, 이상룡, 이순욱, 정대성, 정은영, 정훈식','부산대학교출판부',to_date('17/02/25','RR/MM/DD'),0,'9788973165384','B','<p>『열린 사고와 표현』은 크게 &lsquo;이론편&rsquo;과 &lsquo;실전편&rsquo;으로 구성되어 있으며, 이론편에서는 글쓰기와 말하기와 관련한 기본적인 능력을 기를 수 있도록 하였다. 실전편에서는 10개의 큰 주제를 두고 우리 시대의 문제의식을 담은 글을 모아서 배치했다. 특히 대학, 자본주의와 노동, 젠더에 역점을 두었다.</p>
Insert into FINAL.BOOK_REG (BR_BNUMBER,BR_STUDENT_ID,BR_NAME,BR_CATEGORY,BR_WRITER,BR_PUBLISHER,BR_ISSUE_DATE,BR_COUNT,BR_ISBN,BR_CONDITION,BR_COMMENT,BR_PRICE,BR_REG_DATE,BR_MOD_DATE,BR_STATUS,BS_ORDER_STATUS,ORIGINAL_FILENAME,RENAME_FILENAME) values (6,'201400264','기술경영','경상계열','김진우 , 강성룡, 김동우, 김예진, 김현동, 박성재 외 13명 지음','박영사',to_date('17/01/20','RR/MM/DD'),0,'9791130303253','C','<p>이 책은 기술경영에 대해 다룬 이론서입니다. 기술경영의 기초적이고 전반적인 내용을 학습할 수 있도록 구성했습니다.</p>
