<p>『미분적분학 1 2 세트』는 미분적분학을 체계적으로 익힐 수 있는 교재이다. 대부분의 미적분학 교과서 분략이 많다고 생각했던 저자들은, 주제들을 효율적인 방법으로 조직하기 이해 일부 절은 간략하게 설명해 분량을 줄였다. 각 장에서 시작 부분의 여백과 사진 등을 제거함으로써, 공간을 절약하고 추가적인 보기 자료는 온라인에서 제공받을 수 있도록 안내한다. 크게 &#39;일변수 함수의 미적분&#39;과 &#39;다변수 함수와 벡터 해석&#39;으로 나눠 구성했다.</p>

